<!DOCTYPE html>
<html lang="en" ng-app="ThermalConsistency">
<head>
  <meta charset="UTF-8">
  <title>Thermal Consistency Test</title>
  <link rel="stylesheet" href="./css/bootstrap.css">
  <link rel="stylesheet" href="./css/fonts.css">
  <link rel="stylesheet" href="./css/page-layout.css">

</head>
<body class="optical-calibration" ng-controller="AppController">

            <div class="stripe"></div>

  <script type="text/javascript" src="./js/libs/jquery.js"></script>
  <script type="text/javascript" src="./js/libs/lodash.js"></script>
  <script type="text/javascript" src="./js/libs/angular.js"></script>
  <script type="text/javascript" src="./js/libs/angular-resource.js"></script>
  <script type="text/javascript" src="./js/libs/angular-ui-router.js"></script>

  <script type="text/javascript" src="./js/app.js"></script>
  <script type="text/javascript" src="./js/routes.js"></script>
  <script type="text/javascript" src="./js/controller.js"></script>

  <script type="text/javascript" src="./js/status.js"></script>

  <script type="text/javascript" src="./js/seconds-display.js"></script>

  <script type="text/javascript" src="./js/status-bar.js"></script>
